import './index.css';
function openInstruction() {
  document.getElementById("Instruction").style.display = "block";
}

function closeInstruction() {
  document.getElementById("Instruction").style.display = "none";
}
function App() {
  return (
    <div className="container">
      <div className="Instruction"> 
      <h1> Інструкція </h1>
      <li>Оберіть формулу та введіть ваші дані
       1.1 Формула автоматично обчислить результат та виведе його у відповідне поле. </li>
       <button className="ButtonCloseInstruction" onClick={closeInstruction} ></button>
      </div>
    <div  className="Head">
    <h1 className="HeadText1">Онлайн калькулятор</h1>
    <h1 className="HeadText2" >Потужності вирових ГЄС</h1>
    <button className="ButtonOpenInstruction" onClick={openInstruction}></button>
    </div>
    </div>
  );
}

export default App;
